const setText = (mem, idx, s)=>{
    const sbin = new TextEncoder().encode(s + "\0");
    mem.set(sbin, idx);
};
const getText = (mem, idx)=>{
    for(let i = 0;; i++){
        if (mem[idx + i] == 0) {
            const s = new TextDecoder().decode(mem.slice(idx, idx + i));
            return s;
        }
    }
};
